about:
Successful start-up & turnaround executive who has been a 5-time CEO, as well as a former COO, Chief Commercial Officer, General Counsel, Board member, and Advisor leading & assisting Private Equity, Venture Capital, and other companies with start-up & launch, high growth, restructuring, recapitalization, M&A, privatization, and shareholder sales in U.S. and international industries focused on: Artificial Intelligence, Machine Learning, Data Science, Data Infrastructure builds/rebuilds, cybersecurity, aviation, transportation & logistics, and government consulting/advisory services.
- Founding officer instrumental in the launch & growth of Richard Branson’s Virgin America in California;
- Restructured, rebranded, re-fleeted, and returned Fiji's national airline to sustainable profitability; 
- Worked directly for Larry Ellison (founder of Oracle) in Hawaii where he fixed, ran, and sold the 2nd largest airline in the state;
- Hired by The World Bank to restructure & privatize a national airline in Africa; and 
- Selected by Goldman Sachs to brief institutional investors.
